io de endurecCATE(3,6) = 0.090         % deformación máximaCATE(3,7) = 600e3         % esfuerzo máximo % modelos del material% ------------------------------------------% concreto inconfinado modelo de Mander% CATE(1,1) = IDCA              identificador de la categoría% CATE(I,2) = 101               identificador del modelo material% CATE(I,3) = FCCO              resistencia a la compresión% CATE(I,4) = ECCO              deformación máxima% CATE(I,5) = ECSR              deformación de agrietamiento% CATE(I,6) = ECSP              deformación de desprendimiento% CATE(I,7) = FCTR              resistencia a la tracción% ------------------------------------------% concreto inconfinado modelo de Park% CATE(I,1) = IDCA              identificador de la categoría% CATE(I,2) = 102               identificador del modelo material% CATE(I,3) = FCCO              resistencia a la compresión% CATE(I,4) = ECCO              deformación máxima% CATE(I,5) = ECSR              deformación de agrietamiento% CATE(I,6) = ECSP              deformación de desprendimiento% CATE(I,7) = FCTR              resistencia a la tracción% ------------------------------------------% concreto confinado activo modelo de Mander% CATE(I,1) = IDCA              identificador de la categoría% CATE(I,2) = 121               identificador del modelo material% CATE(I,3) = FCCO              resistencia a la compresión% CATE(I,4) = ECCO              deformación máxima% CATE(I,5) = ECSR              deformación de agrietamiento% CATE(I,6) = ECSP              deformación de desprendimiento% CATE(I,7) = FCTR              resistencia a la tracción% CATE(I,8) = POII              relación de Poisson inicial% CATE(I,9) = POIM              relación de Poisson máxima% CATE(I,10) = RECB              recubrimiento% CATE(I,11) = RTRE             espaciamiento entre ref transv% CATE(I,12) = RTRT             tipo de refuerzo transversal% CATE(I,13) = RTRD             díametro del ref transversal% CATE(I,14) = NBLO             número de barras de ref long% CATE(I,15) = EFRA             desns de energía de frac acero% CATE(I,16) = PFRA             potencia P en la ec del acero% ------------------------------------------% concreto confinado activo modelo de Park% CATE(I,1) = IDCA              identificador de la categoría% CATE(I,1) = 122               identificador del modelo material% CATE(I,2) = FCCO              resistencia a la compresión% CATE(I,3) = ECCO              deformación máxima% CATE(I,4) = ECSR              deformación de agrietamiento% CATE(I,5) = ECSP              deformación de desprendimiento% CATE(I,6) = FCTR              resistencia a la tracción% CATE(I,7) = 0                 parámetro no utilizado% CATE(I,8) = 0                 parámetro no utilizado% CATE(I,9) = RECB              recubrimiento% CATE(I,10) = RTRE             espaciamiento entre ref transv% CATE(I,11) = RTRT             tipo de refuerzo transversal% CATE(I,12) = RTRD             díametro del ref transversal% ------------------------------------------% concreto confinado pasivo modelo de Madas% CATE(I,1) = IDCA              identificador de la categoría% CATE(I,1) = 141               identificador del modelo material% CATE(I,2) = FCCO              resistencia a la compresión% CATE(I,3) = ECCO              deformación máxima% CATE(I,4) = ECSR              deformación de agrietamiento% CATE(I,5) = ECSP              deformación de desprendimiento% CATE(I,6) = FCTR              resistencia a la tracción% CATE(I,7) = POII              relación de Poisson inicial% CATE(I,8) = POIM              relación de Poisson máxima% CATE(I,9) = RECB              recubrimiento% CATE(I,10) = RTRE             espaciamiento entre ref transv% CATE(I,11) = RTRT             tipo de refuerzo transversal% CATE(I,12) = RTRD             díametro del ref transversal% CATE(I,13) = NBLO             número de barras de ref long% CATE(I,14) = EFRA             desn